import React from 'react';
import '../App.css';
import { PokemonGrid } from './PokemonGrid';

const Entrada=()=>{
    return(
        <div className="Entrada">
        <button onClick={<PokemonGrid />}  className='buto-de-entrada'>Entrar</button>
      
       </div>
    )
}
export default Entrada
